import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button'
import Badge from 'react-bootstrap/Badge'

function App() {
  return (
    <div className="App">
      <header className="App-header">
          Welcome To Screamify
      </header>
      <body>
        <Button variant="light">SCREAM</Button>{' '}
        <Badge variant="secondary">SCREAM2</Badge>
      </body>
    </div>
  );
}

export default App;
